import React from "react";


function Select_Range(){
    return(
        <>
        <div className="range">
            <button class="select" onclick="show()"> Select Range </button>
               <div id="popup">
                  <input id="myrange" type="range" min="0.5" max="15" value="2" class="slider" title="Please choose the delivery range area"></input>
                  <p><span>Va</span></p>
               </div>
        </div>
         
        </>
    );
}
export default Select_Range;
